import { useState } from "react";

function Login() {
  const [username, setUsername] = useState(null);
  return (
    <div>
      <form>
        <label htmlFor="username"> Username</label>
        <input
          id="username"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        />
      </form>
    </div>
  );
}

export default Login;
